is_package: true
container:
  type: HtmlTemplate
  properties: {html: '@theme:standard-page.html'}
  event_bindings: {}
components:
- type: ColumnPanel
  properties: {col_widths: '{"ENYZVD":15,"TVNDOS":45}'}
  name: content_panel
  layout_properties: {slot: default}
  components:
  - type: Label
    properties: {role: null, align: left, tooltip: '', border: '', foreground: '',
      visible: true, text: Previous Forms, font_size: null, font: '', spacing_above: small,
      icon_align: left, spacing_below: small, italic: false, background: '', bold: false,
      underline: false, icon: ''}
    name: label_1
    layout_properties: {grid_position: 'ICJYET,YQRFUY'}
  - type: DataGrid
    properties:
      role: null
      columns:
      - {title: Column 1, id: EVCOPM, data_key: column_1}
      - {title: Column 2, id: HMTFLI, data_key: column_2}
      - {title: Column 3, id: HKBRYX, data_key: column_3}
      - {title: Column 4, id: OJKXDS, data_key: column_4}
      - {title: Column 5, id: TQNHSB, data_key: column_5}
      auto_header: false
      tooltip: ''
      border: ''
      foreground: ''
      rows_per_page: 20
      visible: true
      show_page_controls: true
      spacing_above: small
      spacing_below: small
      background: ''
    name: data_grid_1
    layout_properties: {grid_position: 'ARPAAL,GZUYLC'}
    components:
    - type: RepeatingPanel
      properties: {spacing_above: none, spacing_below: none, item_template: build.select_form.select_form_row}
      name: repeating_panel_1
      layout_properties: {}
    event_bindings: {}
  - type: Label
    properties: {role: null, align: left, tooltip: '', border: '', foreground: '',
      visible: true, text: Start a new form, font_size: null, font: '', spacing_above: small,
      icon_align: left, spacing_below: small, italic: false, background: '', bold: false,
      underline: false, icon: ''}
    name: label_2
    layout_properties: {grid_position: 'QEKFNW,ENYZVD'}
  - type: Button
    properties: {role: primary-color, align: left, tooltip: '', border: '', enabled: true,
      foreground: '', visible: true, text: '', font_size: null, font: '', spacing_above: small,
      icon_align: left, spacing_below: small, italic: false, background: '', bold: false,
      underline: false, icon: 'fa:plus'}
    name: primary_color_1
    layout_properties: {grid_position: 'QEKFNW,TVNDOS'}
    event_bindings: {}
  event_bindings: {}
- type: FlowPanel
  properties: {}
  name: navbar_links
  layout_properties: {slot: nav-right}
